import React from 'react';
import './homepage.scss';

function App() {
  return (
    <div className='homepage'>
      <div className='directory-menu'>
        <div className='menu-item'>
            <h1>Tanks</h1>
            <span>Shop now</span>
        </div>
      </div>
    </div>
  );
}

export default App;
